import React from 'react';
import { Box, Flex, Image, Button} from 'rebass';
// import logo from "../static/ftwllogo.png";
import './Navbar.css';

function Navbar() {
  return (
    <div className="Navbar" style={styles}>
      <Flex>
        <Box
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          ml="auto"
          mr="auto"
          color="black"
          bg="white">
          <Image sx={{width:117, height:116, paddingLeft}} src={'../static/ftwllogo.png'} />
        </Box>
        <Box
          fontSize={2}
          ml="auto"
          mr="auto"
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="red">
          <div className="box">
          About Us
          </div>
        </Box>
        <Box
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="orange">
          <div className="box">
          Ways to Give  
          </div>
        </Box>
        <Box
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="yellow">
          <div className="box">
          Found an Animal?
          </div>
        </Box>
        <Box
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="green">
          <div className="box">
          News & Events
          </div>
        </Box>
        <Box
          fontSize={2}
          width={[1 / 2, 1 / 2, 1 / 2]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="white">
          <Flex>
            <Image src={'../static/Facebookicon.png'} variant="avatar" />
            <Image src={'../static/Instagramicon.png'} variant="avatar" />
            <Image src={'../static/Twittericon.png'} variant="avatar" />
          </Flex>
          <Flex>
          <Button sx={{backgroundColor:"orange"}} variant='primary' mr={2}>
            Donate
          </Button>
          <Button sx={{backgroundColor:"green"}} variant='primary' mr={2}>
            Contact Us
          </Button>
          </Flex>
        </Box>
      </Flex>
    </div>
  );
}

export default Navbar;

const styles = {
  'background-color': 'white',
  'text-color': 'black',
  'padding-bottom': 120,
};
